import { RouterProvider, createBrowserRouter } from 'react-router-dom';
import './App.css';
import Login from './pages/Login';

function App() {
  const classes = use
  const defaultRouter = createBrowserRouter([
    {
      path: "/",
      element: <Login/>
    },
  ])

  return (
    <div className="App">
      <RouterProvider router={defaultRouter}/>
    </div>
  )
}

export default App;
